      "delete":{
        "tags":[
          "Time Sheets"
        ],
        "summary":"Deleting a time sheet",
        "operationId":"deleteTimeSheet",
        "description":"This method destroys an existing time sheet. It renders time sheet itself. It renders a 404 if id is invalid.",
        "parameters":[
          {
            "name":"timeSheetId",
            "in":"path",
            "required":true,
            "schema":{
              "type":"string"
            }
          }
